import React from "react";
import MenuHamburguer from "./MenuHamburguer";
import Logo from "../assets/images/logo.png"
import "../assets/css/style_login.css";

function MenuLogin() {

    return (

        <div class="conteiner">

            <div class="logo">
                <img src={Logo} alt="" width="65%"></img>
            </div>

            <div class="menu">

                <a href="/#">Home</a>
                <a href="/#">Sobre nós</a>
                <a href="/#">Contato</a>

            </div>

            <div class="botao">

                <button class="botao-cadastro"><b>Cadastre-se</b></button>
            </div>

            <MenuHamburguer />

        </div>
    );
};

export default MenuLogin;
